INSERT INTO `PLANTS` (`Plant_ID`, `Scientific_Name`, `Common_Name`, `Taxonomy`, `Ayurvedic_Name`, `General`, `Description_Macroscopic`, `Description_Microscopic`, `Important_Ayurvedic_Formulations`, `Ayurvedic_Therapeutic_Uses`, `Common_Ayurvedic_Uses`, `Recommended_Dose`) VALUES
(1, 'Withania somnifera', 'Ashwagandha', 'cellular organisms; Eukaryota; Viridiplantae; Streptophyta; Streptophytina; Embryophyta; Tracheophyta; Euphyllophyta; Spermatophyta; Magnoliophyta; Mesangiospermae; eudicotyledons; Gunneridae; Pentapetalae; asterids; lamiids; Solanales; Solanaceae; Solanoideae; Physaleae; Withania', 'AáVAGANDHË', 'A¿vagandh¡ consists of dried mature roots of Withania somnifera Dunal. (Fam. Solanaceae), a perennial shrub, found in waste land, cultivated field and open grounds throughout India, widely cultivated in certain areas of Madhya Pradesh and Rajasthan , roots collected in winter, washed and cut into short pieces.', 'Roots straight, unbranched, thickness varying with age. roots bear fibre-like\r\nsecondary roots, outer surface buff to grey-yellow with longitudinal wrinkles, crown\r\nconsists of 2-6 remains of stem base, stem bases variously thickened, nodes prominent\r\nonly on the side from where petiole arises, cylindrical, green with longitudinal wrinkles,\r\nfracture, short and uneven, odour, characteristic, taste, bitter and acrid.', 'Transverse section of root shows cork exfoliated or crushed, when present\r\nisodiamatric and non-lignified, cork cambium of 2-4 diffused rows of cells, secondary\r\ncortex about twenty layers of compact parenchymatous cells, phloem consists of sieve\r\ntubes, companion cells, phloem parenchyma, cambium 4-5 rows of tangentially\r\nelongated cells, secondary xylem hard forming a closed vascular ring separated by\r\nmultiseriate medullary rays, a few xylem parenchyma', 'A¿vagandh¡dyariÀ¶a, A¿vagandh¡di Lehya, Bal¡¿vagandhal¡kÀ¡di Taila', 'KÀaya, Daurbalya, V¡taroga, áotha, Klaibya', 'The root of Asvagandha is used in the form of powder to treat consumption, excessive emaciation, bronchial asthma, rheumatic ailments, insomnia, cardiac diseases, wound due to accident, suppression of urine, and for conception in sterility, Rejuvinative / As Rasayana Mandukaparni, (Centella asiatica ) sankhapuspi (convolvulus microphylla?) , asvagandha and satavari (asparagus racemosus) should be used in order to promote intellect, life-spin, stability and strength (AH.U.39.61) One may also take powder of sarkara, asvagandha and pippali (piper longum) mixed with ghee and honey (SS.U.41.41) Weight loss in children / Balasosa Ghee is cooked with one-fourth paste of asvagandaha and ten times milk. It promotes development of body and is useful in emaciated children (VM.67.9)', '3-6 g of the drug in powder form'),
(2, 'Curcuma longa', 'Turmeric; Indian saffron', 'cellular organisms; Eukaryota; Viridiplantae; Streptophyta; Streptophytina; Embryophyta; Tracheophyta; Euphyllophyta; Spermatophyta; Magnoliophyta; Mesangiospermae; Liliopsida; Petrosaviidae; commelinids; Zingiberales; Zingiberaceae; Curcuma', 'HARIDRË', 'Haridr¡ consists of the dried and cured rhizomes of Curcuma longa Linn. (Fam. Zingiberaceae), a perennial herb extensively cultivated in all parts of the country, crop is harvested after 9-10 months when lower leaves turn yellow rhizomes carefully dug up with hand-picks between October-April and cured by boiling and dried.', 'Rhizomes ovate, oblong or pyriform (round turmeric) or cylindrical, often short branched (long turmeric), former about half as broad as long, latter 2-5 cm long and about 1-1.8 cm thick, externally yellowish to yellowish-brown with root scars and annulations of leaf bases, fracture horny, fractured surface orange to reddish brown, central cylinder twice as broad as cortex: odour and taste characteristic.', 'Transverse section of rhizome shows epidermis with thick-walled, cubical cells of\rvarious dimensions, cortex characterised by the presence of mostly thin-walled rounded\rparenchyma cells scattered collateral vascular bundles, a few layers of cork developed\runder epidermis and scattered oleo-resin cells with brownish contents; cork generally\rcomposed of 4-6 layers of thin-walled, brick-shaped parenchyma, cells of ground tissue\rcontain starch grains of 4-15 μ in diameter, oil cell with suberised walls containing\reither orange-yellow globules of volatile oil or amorphous resinous matter, vessels\rmainly spirally thickened, a few reticulate and annular.', 'Haridr¡ Kha¸·a', 'ViÀavik¡ra, KuÀ¶ha, Vra¸a, Tvagroga, Prameha, P¡¸·u, á¢tapitta, P¢nasa', 'N/A', '1-3 g of the drug in powder form'),
(3, 'Aloe vera', 'Aloe; Bitter Aloes', 'cellular organisms; Eukaryota; Viridiplantae; Streptophyta; Streptophytina; Embryophyta; Tracheophyta; Euphyllophyta; Spermatophyta; Magnoliophyta; Mesangiospermae; Liliopsida; Petrosaviidae; Asparagales; Asphodelaceae; Asphodeloideae; Aloe', 'KANYËSËRA', 'Kany¡s¡ra consists of dried juice of leaves of Aloe barbadensis Mill. Syn. Aloe vera Tourn.ex Linn, Aloe indica Royle. (Fam. Liliaceae), shrub planted in many Indian gardens and found growing throughout India.', 'Dark chocolate brown, to black, compact, irregular masses: surface dull, opaque\rwith slightly vitreous appearance, odour, characteristic, taste, nauseous and bitter.', 'Powder when mounted in glycerin or lactophenol and examined under the microscope shows innumerable crystalline, yellowish-brown to chocolate coloured\rparticles of varying size and shape.', 'RajaÅpravartin¢ Va¶¢, Cukkumtippaly¡di Gu¶ik¡', 'Udararoga, KaÀ¶¡rtava, Jvara, Yak¤dvik¡ra', 'The leaves and root of Kumari is used in the form of juice to treat spleen enlargement, epilepsy, penile wart, dysuria, inflammation in penis, abscess, jaundice, gulma, mastitis, headache and amenorrhoea.', '125 - 500 mg of the drug in powder form'),
(4, 'Phyllanthus emblica', 'Emblic Myrobalan', 'cellular organisms; Eukaryota; Viridiplantae; Streptophyta; Streptophytina; Embryophyta; Tracheophyta; Euphyllophyta; Spermatophyta; Magnoliophyta; Mesangiospermae; eudicotyledons; Gunneridae; Pentapetalae; rosids; fabids; Malpighiales; Phyllanthaceae; Phyllanthoideae; Phyllantheae; Phyllanthus', 'ËMALAKÌ', 'Ëmalak¢ consists of pericarp of dried mature fruits of Emblica officinalis Gaertn. Syn. Phyllanthus emblica Linn. (Fam. Euphorbiaceae); mostly collected in winter season after ripening and in Kashmir in summer, a small or medium sized tree, found both in natural state in mixed deciduous forests of the country ascending to 1300 m on hills; cultivated in gardens, homeyards or grown as a road side tree.', 'Fruit, globose, 2.5-3.5 cm in diameter, fleshy, smooth with six prominant lines;\rgreenish when tender, changing to light yellowish or pinkish colour when mature, with a\rfew dark specks: taste, sour and astringent followed by delicately sweet taste.', 'Transverse section of mature fruit shows an epicarp consisting of single layer of\repidermis and 2-4 layers of hypodermis; epidermal cell, tabular In shape, covered externally\rwith a thick cuticle and appear in surface view as polygonal; hypodermal cells tangentially\relongated, thick-walled, smaller in dimension than epidermal cells; mesocarp forms bulk of\rfruit, consisting of thin-walled parenchymatous cells with intercellular spaces, peripheral 6-9\rlayers smaller, ovoid or tangentially elongated while rest of cells larger in size, isodiametric\rand radially elongated; several collateral fibrovascular bundles scattered throughout\rmesocarp consisting of xylem and phloem; xylem composed of tracheal elements, fibre\rtracheids and xylem fibres; tracheal elements show reticulate scalariform and spiral\rthickenings; xylem fibres elongated with narrow lumen and pointed end; mesocarp contains\rlarge aggregates of numerous irregular silica crystals.', 'Cyavanapr¡¿a, Dh¡tr¢ Lauha, Dh¡try¡di Gh¤ta, Triphal¡ C£r¸a', 'Raktapitta, Amlapitta, Prameha, D¡ha', 'The fruit and seed of Amalaki is used in the form of powder and juice to treat fever, lack of appetite, piles, worms, anaemia, jaundice, intrinsic haemorrhage, hoarseness of voice, hiccough, cough, fainting, heart diseases, vomiting, burning sensation, abdominal pain, leprosy, rheumatism, erysipelas, , pox, greying of hair, diabetes, suppression of urine, leucorrhoea, burning sensation in female genitals, eye diseases, as preventive measure, for promoting intellect, as rejuvinative, and aphrodisiac. Diabetes:In case of diabetes /prameha fruit juice or powder of the amalaki fruit and powder of nisa (curcuma longa) in equal quantity is recommended.(10-15 gms) ( Ah.U.40) Rejuvinative Daily intake of amalaki fruit in recommended as a rejuvinative. (Ah.U.39). In retains vitality, increases life span, youthfulness and resistance power. Eye diseases Powder of amalaki, harethaki (Terminalia chebula) and vibhethaki, (Terminalia bellerica) is used internally and externally in eye diseases. Laxative. Powder of amalaki, harethaki (Terminalia chebula) and vibhethaki, (Terminalia bellerica) is used internally with hot water as a laxative(10-15 gms).', '3-6 g of the drug in powder form'),
(5, 'Asparagus racemosus', 'Satavari', 'cellular organisms; Eukaryota; Viridiplantae; Streptophyta; Streptophytina; Embryophyta; Tracheophyta; Euphyllophyta; Spermatophyta; Magnoliophyta; Mesangiospermae; Liliopsida; Petrosaviidae; Asparagales; Asparagaceae; Asparagoideae; Asparagus', 'áATËVARÌ', 'át¡vari consists of tuberous roots of Asparagus recemosus Willd. (Fam. Liliaceae), an ascending, spinous much branched, perennial climber found throughout the country.', 'Root tuberous, 10 to 30 cm in length and 0.1 to 0.5 cm thick, tapering at both ends with longitudinal wrinkles; colour cream; taste, sweetish.', 'Shows an outer layer of piliferous cells, ruptured at places, composed of small, thin1 walled, rectangular asymetrical cells, a number of cells elongated to form unicellular root hairs; cortex comprises of 25 to 29 layers, distinct in two zones, outer and inner cortex; outer cortex consists of 6 or 7 layers, compactly arranged, irregular to polygonal, thick walled, lignified cells; inner cortex comprise of 21 to 23 layers, oval to polygonal, thinwalled, tangentially elongated cells with intercellular spaces; stone cells, either singly or in groups, form a discontinuous to continuous ring in the upper part of this region; raphides of calcium oxalate also present in this region; 2 or 3 layers of stone cells encirle the endodermis; endodermis composed of thin-walled parenchymatous cells; pericycle present below endodermis; stele ex arch and radial in position; xylem consist of vessels, tracheids and parenchyma; xylem vessels have pitted thickening; phloem patches consists of usual element; pith composed of circular to oval parenchymatous cells, a few cells slightly lignified.', 'áat¡var¢ Gu·a, Brahma Ras¡yana, P£ga Kha¸·a, Saubh¡gya áu¸¶hi, Mah¡ N¡raya¸a Taila, B¤hat Ch¡gal¡dya Gh¤ta, áat¡var¢ Gh¤ta, áat¡var¢ Kalpa, A¿vagandh¡riÀ¶a, N¡rasimha C£r¸a', 'áotha, KÀaya, Pari¸¡ma á£la, Gulma, At¢s¡ra, Rakt¡tis¡ra, Raktavik¡ra, M£trarakta, Amlapitta, Ar¿a, V¡tajvara, Svarabheda, Nakt¡ndhya, V¡tarakta, Raktapitta, Visarpa, S£tik¡ Roga, Stanya DoÀa, Stanya KÀaya', 'The root of Satavari is used in the form of juice, paste, decoction and powder to treat intrinsic haemorrhage, diarrhoea, piles, hoarseness of voice, cough, arthritis, poisoning, diseases of female genital tract, erysipelas, fever, as aphrodisiac and as rejuvinative.As rejuvinative/ Rasayana:Ghee cooked with paste and decoction of satavari and added with sugar is used as a rejuvinative (AH.U.39.157).As galactagogue / increases breast milk:Satavari pounded and taken with milk increases the flow of breast-milk (10-20 gms) (YR.P.427)', '3-6 gm of the drug.');
